<!DOCTYPE html>
<html lang="en">
<head>
	<meta charset="utf-8">
	<title>JSDoc Index</title>
</head>

<body>

<h1>All Symbols</h1>

<ul>
{{#docs}}
    <li class="symbol">
        <i>{{kind}}</i> {{name}}{{#description}} - {{#summarize}}{{description}}{{/summarize}}{{/description}}
    </li>
{{/docs}}
</ul>

</body>
</html>
